import React from 'react';
import CardTitle from './CardTitle/CardTitle.js';
import PetPic from './PetPic/PetPic.js';
import PlayButtons from './PlayButtons/PlayButtons.js';
import ReactCountdownClock  from 'react-countdown-clock';
import './petcard.css';

class PetCard extends React.Component {
  constructor(props) {
    super(props);
    
    this.state={
      pet: ''
    }
  }

  render () {
    return (
      <div className="centered-study" id="mainWrap">
      <div className="half">
        <div id="countersWrapperCard">
          <div className="two-timers">
            <div className="timer">
              <p>Time to next playtime:</p>
              <div className="countdown">
                <ReactCountdownClock 
                  seconds={43200}
                  color="#acacac"
                  alpha={0.9}
                  size={100}
                  /*onComplete={myCallback}*/ />
                </div>
            </div>
            <div className="timer">
              <p>Time to next feeding:</p>
              <div className="countdown">
                <ReactCountdownClock 
                  seconds={43200}
                  color="#acacac"
                  alpha={0.9}
                  size={100}
                  /*onComplete={myCallback}*/ />
                </div>
            </div>
          </div>
          <div className="two-timers">
            <div className="timer">
              <p>Time to next playtime:</p>
              <div className="countdown">
                <ReactCountdownClock 
                  seconds={43200}
                  color="#000"
                  alpha={0.9}
                  size={100}
                  /*onComplete={myCallback}*/ />
                </div>
            </div>
            <div className="timer">
              <p>Time to next feeding:</p>
              <div className="countdown">
                <ReactCountdownClock 
                  seconds={43200}
                  color="#000"
                  alpha={0.9}
                  size={100}
                  /*onComplete={myCallback}*/ />
                </div>
            </div>
          </div>
        </div>
      </div>
      <div className="half purple">
        <div id="lang-title">
          <CardTitle />
          <hr />
          <PetPic />
          <hr />
          <PlayButtons />
        </div>
      </div>
    </div>
    );
  }
}

export default PetCard;
